import React, { useContext, useEffect } from "react";
import { useNavigate } from "react-router-dom";

import Logo from "../../assets/Logo.svg";
import { UserContext } from "../../contexts/UserContext";
import { TechsContext } from "../../contexts/TechsContext";

import { StyledSection } from "../../styles/section";
import { StyledNav } from "../../styles/nav";
import { StyledImg } from "../../styles/image";
import { StyledSpan, StyledTitle } from "../../styles/typography";
import { StyledHeader } from "../../styles/header";
import { StyledMain } from "../../styles/main";
import { StyledButton } from "../../styles/buttons";
import Technologies from "./Technologies/Technologies";

export const Dashboard = () => {
  const navigate = useNavigate();
  const { user, logout } = useContext(UserContext);
  const { techs, userTechs } = useContext(TechsContext);


  useEffect(() => {
    const token = localStorage.getItem("@kenzieHub:token");
    !token && navigate("/");
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  return (
    <StyledSection>
      <StyledNav position="one" width="two">
        <StyledImg src={Logo} alt="" />
        <button onClick={() => logout()}>Sair</button>
      </StyledNav>
      <StyledHeader>
        <div>
          <StyledTitle fontSize="two" tag="h1">
            Ol√°, {user?.name}
          </StyledTitle>
          <StyledSpan fontSize="three" color="one">
            {user?.course_module}
          </StyledSpan>
        </div>
      </StyledHeader>
      <StyledMain>
        <StyledSection align="two">
          <StyledTitle fontSize="one" margin="three" text="one" tag="h2"> Tecnologias </StyledTitle>
          <StyledButton>+</StyledButton>
        </StyledSection>
        {!user?.techs.length ? (
          <StyledTitle> Nenhuma tecnologia foi cadastrada ainda! </StyledTitle>
        ): ( user.techs.map((tech) => <Technologies techs={techs}/>))}
      </StyledMain>
    </StyledSection>
  );
};
